import NewsItem from './NewsItem'

export class News extends Component {
  render() {
    return (
      <div className='container my-3'>
       <h2>NewsMonkey-Top Headlines</h2>
       
      <div className="row">
      {this.state.articles.map((element) => { return 
       <div className="col-md-4">
        <NewsItem key={element.url} title={element.title} discription={element.description}imageurl="https://www.winnipegfreepress.com/wp-content/uploads/sites/2/2025/04/3185135_web1_2025041310048-20250413080448-67fbb303711e11534e223708jpeg_131412.jpg" newsurl="TODO"></NewsItem>
        </div>
      })}
      </div>
      </div>
      
    )

  }
}

export default News
